import logo from '../logo.svg';
import '../App.css';
import MyButton from '../Components/Button/Button';
import Navbar from '../Components/Navbar/Navbar';
import { Link } from 'react-router-dom';

function MyOtherButton() {
    return (
      <button className='AppCssButton'>Segundo botón</button>
    );
  }

export function Home() {
    return (
        <>
            <Navbar/>
            <h2>Boton importado de la carpeta Components.</h2>
            <MyButton/>
            <h2>Botón creado desde App.js</h2>
            <MyOtherButton />
            <h2>Usando Links de React Router</h2>
            <Link to=""></Link>
        </>
    )
}
